import React from 'react';
import photo from '../images/photo.png'
import twitter_logo from '../images/twitter logo.jpeg'

const Contact = () => {
  return (

    <>
      <main>

        <h2>Contact</h2>

        <div>
          <img src={photo} alt="" width="100" height="100"/>
        </div>

        <h2>Email</h2>
        <h2>saad.saziz@gmail.com</h2>

        <h2>Twitter</h2>
        <img src={twitter_logo} alt="" width="100" height="100"/>
        <h2>@_saadaziz</h2>

      </main>
    </>
  );
}

export default Contact;
